          "id": "31fff375f9a6d2f0770f1efe528b9bb40782bf54",
          "message": "feat(mcp): add debug logging support for MCP server (#1636)\n\n## Summary\n\n- Add debug logging support for MCP server to help with troubleshooting\nand development\n- Enable conditional debug output when `--debug` flag is used with\n`--mcp`\n- Provide visibility into server initialization and connection status\n\n## Changes\n\n- **Add debug option to `McpServerOptions`**: New optional `debug`\nboolean field\n- **Pass debug option from CLI**: Forward `--debug` flag from CLI to MCP\nserver options\n- **Add conditional debug logging**: Log server setup, version,\ninitialization, and connection events\n- **Use existing debug infrastructure**: Leverages textlint's existing\ndebug library with `textlint:mcp` namespace\n\n## Usage\n\n```bash\n# Enable MCP server debug logging\ntextlint --mcp --debug\n\n# Or with environment variable for more control\nDEBUG=textlint:mcp textlint --mcp --debug\n```\n\n## Debug Output Example\n\n```\ntextlint:mcp Setting up MCP server with options: {\"configFilePath\":\"/path/.textlintrc.json\",\"debug\":true,\"cwd\":\"/current/path\"}\ntextlint:mcp Server version: 14.0.4\ntextlint:mcp MCP server initialized successfully\ntextlint:mcp Connecting MCP server to stdio transport...\ntextlint:mcp MCP server connected and ready to accept requests\n```\n\n## Benefits\n\n- **Troubleshooting**: Easier to diagnose MCP server startup issues\n- **Development**: Better visibility during MCP integration development\n- **Consistency**: Uses same debug patterns as rest of textlint codebase\n- **Non-intrusive**: Only outputs when explicitly requested with\n`--debug`\n\nðŸ¤– Generated with [Claude Code](https://claude.ai/code)\n\n---------\n\nCo-authored-by: Claude <noreply@anthropic.com>",
