          "message": "fix(kernel): add browser compatibility for timing utility (#1663)\n\n## Summary\n- Fix `process is not defined` error when building @textlint/kernel with\nVite\n- Add browser environment detection to timing utility\n- Disable timing functionality in browser environments while preserving\nNode.js compatibility\n\n## Problem\nWhen building @textlint/kernel with Vite for browser environments, it\nthrows `Uncaught ReferenceError: process is not defined` at runtime\nbecause the timing utility uses Node.js-specific `process` object.\n\n## Solution\n- Added browser environment detection using `typeof process ===\n\"undefined\"`\n- Modified timing functions to return original functions unchanged in\nbrowser environments\n- Preserved full timing functionality in Node.js environments\n- Updated TypeScript types for better compatibility\n\n## Test plan\n- [x] Build @textlint/kernel successfully with TypeScript\n- [x] Verify timing functionality still works in Node.js environments\n- [x] Test that browser builds no longer throw process-related errors\n\nðŸ¤– Generated with [Claude Code](https://claude.ai/code)\n\n---------\n\nCo-authored-by: Claude <noreply@anthropic.com>\nCo-authored-by: Copilot <175728472+Copilot@users.noreply.github.com>",
